   function getSquare(){
    return document.getElementById("carre");
   }
   function getPos(){
	var obj={};
	var sqr=getSquare().style;
	obj.x=parseInt(sqr.left?sqr.left:0)
	obj.y=parseInt(sqr.top?sqr.top:0)
	return obj
   } 
   function moveSquare(dir,tab){
   var sq=getSquare().style;
   var pos=getPos();
    switch(dir.toString()){
		case "1":
          sq.top=(pos.y-40)+"px";
          break;
		case "2":
          sq.top=(pos.y+40)+"px";
          break;
		case "3":
          sq.left=(pos.x+40)+"px";
          break;
		  case "4":
          sq.left=(pos.x-40)+"px";
          break;
      default:
    }
	isMove(tab)
   }

   function isMove(tab){
	var pos=getPos();
	tab[0]=pos.y==0?0:1;
	tab[1]=pos.x==120?0:1;
	tab[2]=pos.y==120?0:1;
	tab[3]=pos.x==0?0:1;
   }
//================================= gestion des sous-programmes =======================
//
spgm={
	busy:false,
	callBackError:null,
	callBack:null,
	isRunning:function(){
		return this.busy;
	},
	send:function(p){
		try{
			this.callBackError=p.callBackError
			this.callBack=p.callBack
			if(this.busy){
				this.callBackError(new Error("1", "Busy")) 
				return false
			}
			window.frameElement.myInterface.initAckCall(p.no);
			for(var key in p.params){
				this.setParamValue(key,p.params[key])
			}
			this.setParamValue("MESSAGE","")
			this.setParamValue("CODRET",-1)
			if(!window.frameElement.myInterface.ackCall()){
				this.busy=false
				this.callBackError(new Error("2", "Not send"))
			}else{
				this.busy=true
			}
		}catch(e){this.busy=false;this.callBackError(e)}
	},
	getParamValue:function(aName){
		return window.frameElement.myInterface.getParamAckCall(aName);
	},
	setParamValue:function(aName,aValue){
		return window.frameElement.myInterface.setParamAckCall(aName,aValue);
	},
	reply:function(aNodeRep){
		var wtrace="spgm.reply"
		try{
			this.busy=false;
			if(this.replySpgmTecError(aNodeRep)) return
			if(this.replyError(aNodeRep)) return
			this.callBack(aNodeRep)
		}catch(e){top.Gr_traceErr(arguments,e,wtrace);throw top.Gr_functionError(arguments);}	
	},
	replySpgmTecError:function(aNodeRep){
		var wtrace="spgm.replySpgmTecError"
		try{
			var wErrn=aNodeRep.getAttribute("errn")
			var wStringMess
			if(wErrn=="0") return false

			var wStringMess =this.replyStringPgmError(aNodeRep)
			this.callBackError(new Error("3",wStringMess))
			return true
		}catch(e){top.Gr_traceErr(arguments,e,wtrace);throw top.Gr_functionError(arguments);}	
	},
	replyStringPgmError:function(aNodeRep){
		var wtrace="spgm.replyStringPgmError"
		try{
			var wStringMess=""
			var wErrn=aNodeRep.getAttribute("errn")
			var wErrl=aNodeRep.getAttribute("errl")
			var wErrm=aNodeRep.getAttribute("errm")
			var wErrp=aNodeRep.getAttribute("errp")
			var wErrt=aNodeRep.getAttribute("errt")
			wStringMess+="errn:" + wErrn
			if(wErrl!="") wStringMess+=" " + "errl:" + wErrl
			if(wErrm!="") wStringMess+=" " + "errm:" + wErrm
			if(wErrp!="") wStringMess+=" " + "errp:" + wErrp
			if(wErrt!="") wStringMess+=" " + "errl:" + wErrt						
			return wStringMess
		}catch(e){top.Gr_traceErr(arguments,e,wtrace);throw top.Gr_functionError(arguments);}	
	},
	replyError:function(aNodeRep){
		var wtrace="spgm.replyError"
		try{
			var wStringMess ="" //this.replyStringPgmError(aNodeRep)
			var wCodeMessValue=this.getParamValue("MESSAGE")
			if (wCodeMessValue!=null){
				if(wCodeMessValue!=""){
					this.callBackError(new Error("4",wStringMess+" "+ wCodeMessValue))
					return true
				}
			}
			return false
		}catch(e){top.Gr_traceErr(arguments,e,wtrace);throw top.Gr_functionError(arguments);}	
	},
	addDesc:function(spgm){
		var dom=window.frameElement.myInterface.xmlDesc.documentElement.selectSingleNode("//ACTS")
		if(dom==null){
			dom=top.Gr_setStringToDom("<acts></acts>")
			document.body.myInterface.xmlDesc.documentElement.appendChild(dom)
		}
		dom.appendChild(spgm.dom.documentElement.cloneNode(true))
	}
}
