function spgmDescription(no,subp){
	this.dom=null
	this.buildXmldesc(no,subp)
}
spgmDescription.prototype.buildXmldesc=function(no,subp){
	var wStringNode='<acb no="'+no+'" subp="'+subp+'">'
	wStringNode+='</acb>'
	this.dom=top.Gr_setStringToDom(wStringNode)					
}
spgmDescription.prototype.addParam=function(type,size,dim,name){
	var d=this.dom.documentElement
	var no=d.childNodes.length+1
	var wNode=this.dom.createNode(1, "PAR", "");
	wNode.setAttribute('NO', no)
	wNode.setAttribute('TYP', type)
	wNode.setAttribute('SZ', size)
	wNode.setAttribute('DIM', dim)
	wNode.setAttribute('NAM', name)
	d.appendChild(wNode)
}
